import { useState } from 'react';
import style from './searchbar.module.css';



export default function SearchBar(props) {
   const [count, setCount] = useState(1);
   let acum = count
   return (
      <div className={style.container}>
         <input className={style.input} type='search' name='search' placeholder='Buscar Personje' />
         <button className={style.button} onClick={props.onSearch}>Buscar</button>
         <button className={style.buttonP} onClick={()=>setCount(count-1)}>Prev</button>
         <p className={style.elementP}>Page: {count} </p>
         <button className={style.buttonP} onClick={()=>setCount(count+1)}>Next</button>
      </div>

   );

}
